import pandas as pd
import pytz
from datetime import datetime

# Set timezone to UTC+8
tz = pytz.timezone('Asia/Shanghai')

# Define target time range
start_time = tz.localize(datetime(2022, 3, 21, 0, 0, 0))
end_time = tz.localize(datetime(2022, 3, 21, 0, 30, 0))
start_timestamp = int(start_time.timestamp())
end_timestamp = int(end_time.timestamp())

# File paths
metric_files = {
    'container': 'dataset/Market/cloudbed-2/telemetry/2022_03_21/metric/metric_container.csv',
    'mesh': 'dataset/Market/cloudbed-2/telemetry/2022_03_21/metric/metric_mesh.csv',
    'node': 'dataset/Market/cloudbed-2/telemetry/2022_03_21/metric/metric_node.csv',
    'runtime': 'dataset/Market/cloudbed-2/telemetry/2022_03_21/metric/metric_runtime.csv',
    'service': 'dataset/Market/cloudbed-2/telemetry/2022_03_21/metric/metric_service.csv'
}

# Load all metric files
metric_data = {}
for name, path in metric_files.items():
    try:
        df = pd.read_csv(path)
        metric_data[name] = df
        print(f"Loaded {name} data with shape: {df.shape}")
    except FileNotFoundError:
        print(f"Warning: {path} not found")
        metric_data[name] = None

# Display unique KPI names for each metric file
kpi_info = {}
for name, df in metric_data.items():
    if df is not None:
        if name == 'service':
            # Service metrics have different columns
            kpi_names = ['rr', 'sr', 'mrt', 'count']
        else:
            kpi_names = df['kpi_name'].unique().tolist()
        kpi_info[name] = kpi_names
        print(f"\n{name} KPIs: {kpi_names}")

# Calculate global P95 and P5 thresholds for each KPI
thresholds = {}
for name, df in metric_data.items():
    if df is not None:
        if name == 'service':
            # Service metrics have different structure
            service_thresholds = {}
            for kpi in ['rr', 'sr', 'mrt', 'count']:
                p95 = df[kpi].quantile(0.95)
                p5 = df[kpi].quantile(0.05)
                service_thresholds[kpi] = {'p95': p95, 'p5': p5}
            thresholds[name] = service_thresholds
        else:
            metric_thresholds = {}
            for kpi in df['kpi_name'].unique():
                kpi_data = df[df['kpi_name'] == kpi]['value']
                p95 = kpi_data.quantile(0.95)
                p5 = kpi_data.quantile(0.05)
                metric_thresholds[kpi] = {'p95': p95, 'p5': p5}
            thresholds[name] = metric_thresholds

print("\nGlobal thresholds calculated for all KPIs")

# Filter data within target time range
filtered_data = {}
for name, df in metric_data.items():
    if df is not None:
        if name == 'service':
            filtered_df = df[(df['timestamp'] >= start_timestamp) & (df['timestamp'] <= end_timestamp)]
        else:
            filtered_df = df[(df['timestamp'] >= start_timestamp) & (df['timestamp'] <= end_timestamp)]
        filtered_data[name] = filtered_df
        print(f"\nFiltered {name} data to shape: {filtered_df.shape}")

# Store variables for later use
start_timestamp, end_timestamp, metric_data, kpi_info, thresholds, filtered_data

